# shortestPathBinaryMatrix.py : https://github.com/cheoljoo/problemSolving/tree/master/leetcode

class Solution:
    def shortestPathBinaryMatrix(self, grid: List[List[int]]) -> int:
        self.count = 0
        self.ans = math.inf
        self.di = [1,0,-1]
        g = [[1 for _ in range(len(grid)+2)] for _ in range(len(grid)+2)]
        visit = [[0 for _ in range(len(grid)+2)] for _ in range(len(grid)+2)]
        for r in range(len(grid)):
            for c in range(len(grid)):
                g[r+1][c+1] = grid[r][c]
        if g[1][1] != 0 :
            return -1
        if g[len(grid)][len(grid)] != 0 :
            return -1
        self.dfs((1,1),(len(grid),len(grid)),1,g,visit)  # start,target , path Count
        if self.ans == math.inf:
            return -1
        return self.ans
    def dfs(self,s,t,pc,g,visit):
        self.count += 1
        sr,sc = s
        tr,tc = t
        # print(pc)
        if pc >= self.ans :
            return
        if sr == tr and sc == tc:
            # self.printTable(g,visit)
            # print("ans:",self.ans,pc)
            self.ans = min(self.ans,pc)
            return
        visit[sr][sc] = 1
        for r in self.di:
            for c in self.di:
                if r != 0 or c != 0:
                    if g[sr+r][sc+c] == 0 and visit[sr+r][sc+c] == 0:
                        self.dfs((sr+r,sc+c),t,pc+1,g,visit)
        visit[sr][sc] = 0
    def printTable(self,g,visit):
        # if self.count >= 200 :
        #     return
        print("[",self.count,"]")
        for r in range(len(g)):
            # for c in range(len(g[0])):
            #     print(g[r][c],"",sep="",end="")
            # print("    ",end="")
            for c in range(len(g[0])):
                print(visit[r][c],"",sep="",end="")
            print()
                

           
def run(s,expect):
    print(len(s),end="")
    start = time.time()
    A = Solution()
    r = A.shortestPathBinaryMatrix(s)
    print(" total_time1 : ", time.time() - start , "-> ", end="") 
    
    if r == expect:
        print("SUCCESS -> ",end="")
    else :
        print("ERROR(",expect,") -> ",sep="",end="")
    print(r, s , end="")  
    print()

